description:
Ha habido problemas con los permisos de Viviana, y no consigue acceder a Facturación Varios.

Dejo aquí esta consulta que nos permitirá consultar sus permisos en producción, y replicarlos en algún compañero para comprobar el acceso.

SELECT \* FROM T03005\_ACCIONES WHERE C03005\_CODAPL IN ('3200', '3270') AND C03005\_ITEACC IN (  
   SELECT C03107\_ITEACC FROM T03107\_PFLACC WHERE C03107\_ITEPFL IN (  
       SELECT C03101\_ITEPFL FROM T03101\_USRPFL WHERE C03101\_ITEUSR = 28302  
   )  
);  
select C03002\_ITEACC from t03002\_MENUS where C03002\_CONTEXTO = 'facturacionVarios' and C03002\_ENLACE = 'calendario.faces';

Además, también he estado con Alessandro por unos problemas con el histórico que ya hemos solucionado.
